const Paragraph = (props) => {
   const {text} = props;
   return <div><p style={{color: 'pink', backgroundColor: 'maroon'}}>{text}</p></div>;
};

function App() {
  return (
    <div>
     <Paragraph text={'Hello World!'}/>
     <Paragraph text={'Porthos'}/>
     <Paragraph text={'Athos'}/>
     <Paragraph text={'Aremous'}/>
    </div>
  );
}

export default App;
